import { render } from "react-dom";
import React, { useState } from 'react'
function App(){
    let vitamins = new Array(13).fill(false);
    const [btnColor, setBtnColor] = useState("red");
    function buttonClicked(){
        console.log('this happened');
          }
    return(
        <div>
            <div id = "macros">
    <div class = "header">Macros</div>
    <div class = "options">
        <div class = "macro">
        <div class = "scale">
            How much protein?
            </div>  
        </div>

        <div class = "macro">
            How much of each fat?
            <div class = "scale">
                Unsaturated
            </div>
            <div class = "scale">
                Omega-3s
            </div>
            <div class = "scale">
                Saturated
            </div>
            <div class = "scale">
                Omega-6s
            </div>
        </div>

        <div class = "macro">
            How much of each Carb?
            <div class = "scale">
                Starches (Complex Carbohydrates)
            </div>
            <div class = "scale">
            </div>
        </div>

    </div>
    </div>

    <div id="micros">
        <div className ="header">Micros</div>
        <h2>Select the ones you want to get more of</h2>
        <div className = "choice">
            <div className ="section">
            <h1>Vitamins</h1>
            <button onClick={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "0">A</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }} 
         id = "1">B1(thiamine)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}
          id = "2">B2(riboflavin)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}
         id = "3">B3(niacin)</button>
            <button onClick={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "4">B5(pantothenic acid)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "5">B6(pyridoxine)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "6">B7(biotin)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "7">B9(folate)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "8">B12(cobalamin)</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "9">C</button>
            <button onClick={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }} id = "10">D</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }}id = "11">E</button>
            <button onClick ={() => {
          btnColor === "red" ? setBtnColor("green") : setBtnColor("red");
        }} 
         style={{ backgroundColor: btnColor }} id = "12">K</button>
            </div>
            <div class ="section">
            <h1>Minerals</h1>
            <button>Calcium</button>
            <button>Phosphorus</button>
            <button>Magnesium</button>
            <button>Sodium</button>
            <button>Chloride</button>
            <button>Potassium</button>
            <button>Sulfur</button>
            <button>Iron</button>
            <button>Manganese</button>
            <button>Copper</button>
            <button>Zinc</button>
            <button>Iodine</button>
            <button>Flouride</button>
            <button>Selenium</button>
            </div>
        </div>
    </div>
    <div id="restrictions">
        <h1>Do any of these apply to you?</h1>
        <button>Vegan</button>
        <button>Vegetarian</button>
        <button>Halal</button>
        <button>Kosher</button>
        <form action ="source.js" method = "post">
            <label  for="Allergies">Allergies:</label>
            <input type="text" id="allergies" name="allergies"></input>
        <button>Select</button>
            </form>
    </div>
    <div class = "footer">
    <a href ="catalog.html">
        <button>Next</button>
        </a>
    </div>
        </div>
    );
}
export default App;
